import * as React from 'react';
import { FeaturedCard } from './FeaturedCard';

export const CarouselCard = ({ bg, data }) => {
  return (
    <>
      <div className={`w-1/3 h-full bg-red-500`}>
        <FeaturedCard {...data} />
      </div>
      <div className={`w-1/3 h-full bg-blue-500`}>hello</div>
      <div className={`w-1/3 h-full bg-green-500`}>hello</div>
    </>
  );
};
